import React from "react";
import TableHead from "./TableHead";
import TableBody from "./TableBody";
import TableFoot from "./TableFoot";

const Table = () => {
  return (
    <table border="1px">
      <TableHead> </TableHead>
      <TableBody> </TableBody>
      <TableFoot> </TableFoot>
    </table>
  );
};

export default Table;
